const Homepage = () => {

    const peoples = [
        {v: 'person', name: 'John'},
        {v: 'person', name: 'Doe'},
        {v: 'person', name: 'Traversy'}
    ]

    return <div>
        <h1> Hello World! </h1>
        {}
        <Link as="persons/person-name" href="[persons]/[person]">
            <a>Person</a>
        </Link>
    </div>
}

export default Homepage
